//call to get genre
app.getGenre = () => {
    $.ajax({
        url: app.trackUrl,
        method: 'GET',
        dataType: 'jsonp',
        data: {
            apikey: app.apiKey,
            format: 'jsonp',
            q_track: app.userTrack,
            q_artist: app.userArtist,
            f_has_lyrics: '1',
            s_track_rating: 'desc'
        }
    })
        .then(function (response) {
            if (response.message.body.track_list[0]) {
                console.log(response);
                app.userChoice = response.message.body.track_list[0].track.primary_genres.music_genre_list[0].music_genre.music_genre_name.toLowerCase();
            } else {
                console.log('Genre search failed');
                app.styleReset();
            }
            // using default styles for genres that are either more obscure or harder to target
            if (app.userChoice == `children's music` || app.userChoice == 'singer/songwriter' || app.userChoice == 'r&b/soul' || app.userChoice == 'hip hop/rap' || app.userChoice == 'christian & gospel' || app.userChoice == 'easy listening' || app.userChoice == 'instrumental' || app.userChoice == 'j-pop' || app.userChoice == 'k-pop' || app.userChoice == 'college rock' || app.userChoice == 'indie rock' || app.userChoice == 'new wave' || app.userChoice == 'classical crossover' || app.userChoice == 'contemporary bluegrass' || app.userChoice == 'contemporary country' || app.userChoice == `jungle/drum'n'bass` || app.userChoice == 'big band' || app.userChoice == 'alternative folk' || app.userChoice == 'contemporary folk' || app.userChoice == 'traditional folk' || app.userChoice == 'alternative rap' || app.userChoice == 'hip - hop' || app.userChoice == 'underground rap' || app.userChoice == 'christan rap' || app.userChoice == 'christian rock' || app.userChoice == 'southern gospel' || app.userChoice == 'contemporary jazz' || app.userChoice == 'crossover jazz' || app.userChoice == 'pop in spanish' || app.userChoice == 'latin urban' || app.userChoice == 'alternative & rock in spanish' || app.userChoice == 'adult contemporary' || app.userChoice == 'pop/rock' || app.userChoice == 'adult alternative' || app.userChoice == 'arena rock' || app.userChoice == 'blues - rock' || app.userChoice == 'death metal/black metal' || app.userChoice == 'hard rock' || app.userChoice == 'heavy metal' || app.userChoice == 'prog - rock/art rock' || app.userChoice == 'idm/experimental' || app.userChoice == 'foreign cinema' || app.userChoice == 'original score' || app.userChoice == 'vocal jazz' || app.userChoice == 'indie pop' || app.userChoice == 'spoken word' || app.userChoice == 'french pop' || app.userChoice == 'downtempo' || app.userChoice == 'ccm') {
                app.styleReset();
            } else {
                app.newStyles();
            }
        });
}

// call to get lyrics 
app.getLyrics = () => {
    app.finalLyrics = '';

    $.ajax({
        url: `${app.lyricUrl}${app.userArtist}/${app.userTrack}`,
        method: 'GET',
        dataType: 'json'
    }).then(function (response) {
        app.finalLyrics = response.lyrics;
        app.printLyrics();
    });

    app.printLyrics();
}

// function for putting the new lyrics on the page
app.printLyrics = () => {
    $('p.lyrics').text('');
    if (app.finalLyrics !== '') {
        $('p.lyrics').html(`${app.finalLyrics}`);
    } else {
        $('p.lyrics').append(`It looks like something went wrong! Please try a different search.`);
    }
}

// functions to initiate style changes based on genre
app.styleReset = () => {
    $('.genre-SVG').text('');
    app.userChoice = 'defaultStyles';
    let genre = app.userChoice;
    $('.genre-SVG').append(`${app.genres[genre]}`);
}

app.newStyles = () => {
    $('.genre-SVG').text('');
    let genre = app.userChoice;
    $('.genre-SVG').append(`${app.genres[genre]}`);
}

// document ready
$(function () {

    // 'Pick a Song' button event listening
    $('.begin-button').on('click', function () {
        // get user search parameters from form
        app.userArtist = $('#user-artist').val();
        app.userTrack = $('#user-track').val();

        // make API requests for genre and lyrics based on user search
        app.getGenre();
        app.getLyrics();
        app.styleReset();
        app.newStyles();

        // scroll to lyrics section
        $('.results').animatescroll();
    });

    // event listener for 'sing another song' button
    $('.bottom').click(function () {
        $(this).scrollTop(0);
        $('#reset').trigger('reset');

        $('html, body').animate({ scrollTop: 0 }, 'slow');
        return false;
    });

    $("#reset-form").bind("click", function () {
        $("input[type=text]").val("");
        $('.results').html(`<p class="lyrics"> </p>`);

        app.styleReset();
    });

});


